import {StyleSheet, View, Text, StatusBar, SafeAreaView, Image, Alert} from 'react-native'
import * as React from 'react';
import { MaterialIcons } from '@expo/vector-icons';
import {createNativeStackNavigator} from '@react-navigation/native-stack'
import { NavigationContainer, useNavigationContainerRef } from '@react-navigation/native';
import { Overview } from '../routes/Overview';
import { Button } from 'react-native-paper';

const Stack = createNativeStackNavigator();

function Default() {
  const navigationRef = useNavigationContainerRef();
  return (
    <View>
      <View style={styles.topLabel}>        
        <Image style={styles.logo}source={{uri:'https://reactnative.dev/img/tiny_logo.png'}}/>           
        <Text style={styles.textLabel}>Progress</Text>
        <MaterialIcons style={styles.account} name="account-circle" size={50} color="black" />
      </View>
      <Text>df</Text>
      <Button 
          title="Overview"
          color = '#2196F3'
          onPress={() => {console.log("df")}}
          style={{position:'absolute', top:50}}
      /> 
    </View>
  );
}

export function Progress() {
  const navigationRef = useNavigationContainerRef();
    return (
      <NavigationContainer independent={true} ref={navigationRef}>
        <Stack.Navigator>
          <Stack.Screen name="Default" component={Default} options={{ headerShown: false }}/>
        </Stack.Navigator>
      </NavigationContainer>
    )
}

const styles = StyleSheet.create({
  container: {
  flex: 1,
  backgroundColor: '#fff',
  alignItems: 'center'
  },
  topLabel: {
      backgroundColor: '#202c40',
      flexDirection: 'row',
      height: 60 
  },
  logo:{
      width:50,
      height:50
  },
  textLabel: {
      fontSize: 40
  },
  account: {
      
  }
});
